description:
Thirumanam Ennum Nikkah is a 2014 Indian Tamil romance film directed by newcomer Aneesh, starring Jai and Nazriya Nazim in the lead roles, while Heebah Patel, Deekshitha Manikkam and Jamal play supporting roles.
Initial release: July 24, 2014 (India)
Director: Anees
Music composed by: M. Ghibran
Producer: V. Ravichandran
Cinematography: Loganathan Srinivasan
